import React, { Component } from 'react';
import './App.css';
import Todos from './component/Todos';
class App extends Component {
  state = {
    todos : [
      {
        id:1,
        title:'Call boss',
        completed: false
      },
      {
        id:2,
        title:'Date with girlfriend',
        completed: false
      },
      {
        id:3,
        title:'Crosscheck all task',
        completed: false
      }
    ]
  }
  render() {
    return (
      <div className="App">
       <Todos todos={this.state.todos} />
      </div>
    );
  }
}

export default App;
